                    "description": "<p>Delphi Murders Unsealed /// Part 2 /// 684</p><p>Part 2 of 2 </p><p><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>On February 13th 2017, two teenaged girls went missing for the trails at the Monon High Bridge in Carroll County, Indiana.  The following day search and rescue teams found the bodies of the two girls, Libby and Abby.  It was more than five years later that Richard Allen was arrested and charged with the murders.  Recently, previously sealed court documents about the case, the arrest, and evidence were unsealed and released to the public. Due to dozens of requests we have decided to discuss these documents and the details of the information found on those pages this week in the Garage.  There are significant details that many have wondered about for over six years now.  Finally, more information is now available in a murder investigation that has been previously cloaked in mystery, silence and uncertainty.</p><p>Recommended Reading - Coal Country Killing; a future, a union, and the murders that changed it all by bestselling authors Robert K. Tanenbaum and Steve Jackson </p>\n",
