                    "description": "<p>Molly Miller & Colt Haynes /// Part 2 /// 682</p><p>Part 2 of 2</p><p><br /><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>July 7th, 2013 - 17 year old Molly Miller and 21 year old Colt Haynes had just met about a 10 days prior when they meet up for a night with others at a party. Molly and Colt leave the house party with a local guy that they both know. His name is James Conn Nipp. Nipp is known well in the area by both civilians and members of local law enforcement. Nipp decided to piss off the police. He was practically begging them for a high speed chase, something he had done several times before. After the police chase Nipp goes home. Molly and Colt have not been seen since. Grab a beer and cool down in the Garage with Nic and the Captain. Happy 4th of July! </p><p><br />Beer of the Week - Hatchback Inferno by Tactical Brewing Company </p><p>Garage Grade - 3 and 3 quarter bottle caps out of 5 </p>\n",
