                    "description": "<p>Frauke Liebs /// Part 2 /// 680</p><p>Part 2 of 2</p><p><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>On June 20th of 2006 Frauke Liebs, a 21 year old nursing student disappeared under very strange and mysterious circumstances. She was met with foul play sometime around or after midnight. That night she was out with friends watching a FIFA World Cup match at a pub. Frauke planned to walk home. After leaving the pub there have been no confirmed sightings of her since. But she did text and call her roommate several times after her disappearance. This is one of Germany’s most intriguing open cases. This week Nic and the Captain also discuss The Lonely Hearts Killers. </p><p>Beer of the Week - Clock Work Tangerine from BrewDog </p><p>Garage Grade - 4 and half bottle caps out of 5 </p>\n",
