                    "uuid": "c3b092cf-db3b-42aa-a94e-2005abc9d37d",
                    "name": "Heather Kullorn /// Part 1 /// 675",
                    "datePublished": 1686699000,
                    "description": "<p>Heather Kullorn /// Part 1 /// 675</p><p>Part 1 of 2</p><p><br /><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>This week we talk about a case that we fear has gone cold. There are good suspects in this case but have all of the possible leads dried up? Back in July of 1999, Heather Kullorn was babysitting an infant overnight. This is odd especially giving the ages. Heather was twelve and the infant was just a little over two months old. Given the ages an overnight babysitting gig does not seem appropriate at all. Heather disappeared in the middle of the night. Blood was found at the scene. The baby thankfully was alive and well when the parents returned home. Police were called and the authorities have been looking for Heather for over twenty years now. We believe the person or persons responsible have likely shared intimate knowledge of the case with someone. If you have any information regarding the disappearance of Heather Kullorn please call the St. Louis Police Department at 314-231-1212. To remain anonymous please call Crimestoppers at 1-866-371-TIPS. </p><p>Beer of the Week - Zipper Ripper by Hoof Hearted Brewing </p><p>Garage Grade - 4 and a half bottle caps out of 5 </p><p>Check out our other show Off The Record available on Apple Subscription, right in the True Crime Garage Apple Podcast feed. </p>\n",
