                    "uuid": "b2c20f36-20d7-4978-b2a6-82a63e2d71d0",
                    "name": "Boys on the Road ////// 674",
                    "datePublished": 1686097666,
                    "description": "<p>Boys on the Road ////// 674</p><p>Part 1 of 1</p><p><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>This week we cover the strange death and likely murder of a teenaged boy from a rural community in Indiana. 16 year old Jason Bolton was out with people who he thought were his friends. The group attended a local party. What happened at the party is up for debate. By the early morning hours of the next day Jason will be dead. Supposedly, Jason and another boy both intoxicated decided on their walk home to lay down in the middle of the road and they both fell asleep or passed out. According to the witness (the driver) Jason was run over to avoid running over the other boy. We will tell you the problems with this story, the investigation or lack thereof and why the facts of the narrative just don’t add up. </p><p>Beer of the Week - Fossil Cove’s Session IPA </p><p>Garage Grade - 4 and a quarter bottle caps </p><p>For additional coverage of the Jonbenet Ramsey case, the Delphi Double Murders case, our bonus shows The Bricca Family Murders and Tony Muncy along with access to our first 50 episodes - Subscribe to our show “Off The Record” available on Apple Podcast. Available NOW - get a 7 day FREE trial and save up to 16% when you sign up today. </p>\n",
