                    "name": "Garage Refill /// 500lb. Serial Killer /// Part 2",
                    "datePublished": 1685540100,
                    "description": "<p>500lb. Serial Killer /// Part 2 /// 174</p><p>Part 2 of 2</p><p><a href=\"http://www.TrueCrimeGarage.com\">www.TrueCrimeGarage.com</a></p><p>December 8th, 1996 - An overweight man picks up a woman from a local bar in southwest Baltimore. He invites her back to his trailer with the promise of drugs and alcohol. She decides to join him. They are only there a short time when he starts making sexual advances toward her. She turns him down. They do some drugs and then his advances became more aggressive. She continues to brush him off and then he attacks her. Somehow she manages to escape and have the man arrested. Just days later this man is arrested again this time for the murder of a young woman. After, he starts talking to investigators about other murders. Tonight we discuss Joe Metheny, his crimes and confessions. Beer of the Week - Duckpin Pale Ale by Union Brewing Garage Grade - 4 out of 5 bottle caps</p><p><a href=\"https://truecrimegarage.com/home\">Beer Fund: https://truecrimegarage.com/home</a></p><p> </p><p> </p>\n",
