                    "name": "Tionda & Diamond Bradley  /// Part 2 /// 673",
                    "datePublished": 1684936800,
                    "description": "<p>Tionda & Diamond Bradley  /// Part 2 /// 673 </p><p>Part 2 of 2 </p><p><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>Sisters Tionda and Diamond have been missing for over twenty years now. Their mother left the two little girls home alone on work day in the summer of 2001. When she returned home, the girls were gone and a note was left saying the two had gone to the playground. Tionda was ten years old and Diamond was just three. This week we go through the complicated timeline of events surrounding their disappearance. This case has been labeled missing and endangered. We believe the girls may have been abducted by someone they knew. The F.B.I. asks that anyone with information about the disappearance of Tionda and Diamond Bradley contact the Chicago Police Department detectives at 312-747-8380 OR your local F.B.I. office. The family’s private detective can be reached at 847-579-9771.</p><p>National Missing Children’s Day is Thursday, May 25th, 2023.  True Crime Garage has worked with and continues to support The National Center for Missing and Exploited Children (NCMEC).  To help in the fundraising efforts to bring kids home and to make sure that every kid has a safe childhood please join us in our efforts by going to our giving page</p><p><a href=\"http://give.missingkids.org/truecrimegarage\" target=\"_blank\">http://give.missingkids.org/truecrimegarage</a><br /> </p><p>Beer of the Week - DownTime Wheat Beer from Bulldog Brewing Company </p><p>Garage Grade - 4 and a quarter bottle caps out of 5 </p><p>Thank you for your continued support of this independent podcast. Tell a friend to join you and us in the Garage next week. Cheers Nic & The Captain</p>\n",
