                    "uuid": "3a462aa1-7bd3-4e0d-b5b4-98103abf1e62",
                    "name": "Lynda Moore /// Part 2 /// 671",
                    "datePublished": 1684342898,
                    "description": "<p>Lynda Moore /// Part 2 /// 671</p><p>Part 2 of 2 </p><p><br /> </p><p><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>On April 15th, 1986 a young mother was attacked and killed in her home.  She was home alone that day while her husband was at work and her two children were at school.  36 year old Lynda Moore was viciously attacked inside her home.  With no sign of forced entry and some pretty random suspects the Vermont State Police were sure to have a difficult time with this murder investigation.  If you have any information that could help this cold case investigation please contact the Vermont State Police Major Crimes Unit by calling 1-802-244-8727.  Tips may also be submitted anonymously at <a href=\"https://vsp.vermont.gov/tipsubmit\" target=\"_blank\">https://vsp.vermont.gov/tipsubmit</a> or by texting keyword VTIPS to 274637 (CRIMES) </p><p>Beer of the Week - Swingin’ by Susquehanna Brewing Company</p><p>Garage Grade 4 out of 5 Bottle Caps </p><p>For everything True Crime go to <a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a> - Check out our store page, sign up on the mailing list for discounts and review our True Crime and Entertainment recommendations on our Recommended page. </p><p>Thanks for listening and thanks for telling a friend, cheers! </p>\n",
