                    "uuid": "4663ad6c-2f36-4148-b464-0e19d299c9aa",
                    "name": "The Little Rock Slasher /// Part 2 /// 662",
                    "datePublished": 1681310396,
                    "description": "<p>The Little Rock Slasher /// Part 2 /// 662</p><p>Part 2 of 2</p><p><a href=\"http://www.truecrimegarage.com/\" target=\"_blank\">www.TrueCrimeGarage.com</a></p><p>From August 2020 through April of 2021 four people were attacked, viscously cut and stabbed and left to bleed out on the streets of Little Rock, Arkansas.  Little Rock Police were quickly able to connect the attacks via evidence and announce to the public that they believe a serial killer was roaming the streets late at night. The killer was apparently attacking people that he saw walking alone. Since then police have not been able to link anymore attacks or killings. Did the killer go dark or has he moved on to another hunting ground? If anyone has information about these attacks or the suspect, call Little Rock Police at 501-371-4636 or email at ASKLRPD@littlerock.gov  There is a reward available for up to $20,000. </p><p>Beer of the Week - Trailbound Hazy Juicy Ale by Highland Brewing </p><p>Garage Grade - 4 and a half bottle caps out of 5 </p><p>Recommended Reading - Devil’s Knot; the true story of the west Memphis three by Mara Leveritt </p>\n",
